import { StyledButton } from './StyledButton'

type Props = {
    text: string,
    background?: '#1a1a1a' | '#1A1A1A';
}

export const Button = (props: Props) => {
    const { text, background } = props
  return (
    <StyledButton background={background} padding="14px" >{text}</StyledButton>
  )
}
